import "./App.css";
import HomePage from "./Homepage/Homepage";
import Navbar from "./Components/Navbar/Navbar";
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Redirect,
} from "react-router-dom";
import Monday from "../src/Pages/Monday";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />

        <Switch>
          <Route exact path="/" component={<h1> home </h1>} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
